// https://atcoder.jp/contests/abc295/tasks/abc295_a

pub fn run(str: &str) -> &str {
    for word in ["and", "not", "that", "the", "you"] {
        if str.contains(word) {
            return "Yes"
        }
    }

    "No"
}

pub fn run2(s: String) -> String {
    if s.split(' ').any(|str| {
        ["and", "not", "that", "the", "you"].contains(&&str)
    }) {
        String::from("Yes")
    } else {
        String::from("No")
    }
}

